import React from 'react';
import { useNavigate } from 'react-router-dom';

const Detail = (props) => {

    const navigate = useNavigate();

    const daydays = props.dayday;
    console.log(props);

    const circle_count = Array.from({ length: 5 }, (el, i) => i);
    console.log(circle_count);

    return (
        <div>
            <div>
                <h2>
                    How was your dayday
                </h2>
            </div>
            <div style={{display: "flex",}}>
                {circle_count.map((num, index) => {
                    return (
                        <div key={index}
                            style={{
                                width: "30px",
                                height: "30px",
                                margin: "10px",
                                border: "7px solid lightgrey",
                                borderRadius: "50%",
                                backgroundColor: "white",
                            }}>
                        </div>
                    )
                })}
            </div>
            <div>
                <button 
                onClick={() => {navigate("/")}}
                style={{
                    outline: "0",
                    border: "1px solid transparent",
                    borderRadius: "20px",
                    backgroundColor: "seagreen",
                    color: "whitesmoke",

                    width: "120px",
                    height: "40px",

                    fontSize: "16px",
                    cursor: "pointer",
                }}>
                    complete
                </button>
            </div>
        </div>
    )
}

export default Detail;
